feat(ng): support for numerical ngTrueValue and ngFalseValue attributes

Checkbox input fields may now be declared with numerical ng-true-value and ng-false-value settings.
The input's corresponding model will be interpreted as a number rather than a string representation.
Regular string configurations which do not parse as numbers will be treated as before.

BREAKING CHANGE: numeric values for ngTrueValue and ngFalseValue attributes are
now interpreted as numbers rather than their string representation. This may affect
cases where a string representation of a number is expected in a checkbox field's
associated model and the identity operator (===) is used for comparison.

To migrate the code, make comparisons with the numerical typed value or use the
equality operator (==) in place of the identity operator to ensure type invariant value
comparison.

Before:

```
    if(scope.value === '1') {
      ...
    }
```
After:
```
    if(scope.value === 1) {
      
    }
    // or
    if(scope.value == 1) {
      ...
    }
    // or
    if(scope.value == '1') {
      ...
    }
```

So we can request with dynamic header value.

```javascript
module.factory('Res', [
  '$resource'
  '$routeParams'
  'globalConfig'

function($resource, $routeParams, globalConfig) {
  resource('/url/:id', {id: "@id"}, {
    patch: {
      method: 'patch',
      headers: {
        'Authorization': function() {
          return "token " + globalConfig.token;
        }
      }
    }
  });
}]);
```

Now it is possible to access a form from a controller using the new `controller as` syntax, without having to access `$scope`:

Old way:
```html
<div ng-controller="MainCtrl as main">
  <form name="form" ng-submit="main.submit()">
  </form>
</div>
```
...
```javascript
.controller('MainCtrl', function($scope) {
  this.submit = function() {
    if $scope.form.$valid {
      // do something!
    }
  }
})
```

New way:
```html
<div ng-controller="MainCtrl as main">
  <form name="main.form" ng-submit="main.submit()">
  </form>
</div>
```
...
```javascript
.controller('MainCtrl', function() {
  this.submit = function() {
    if this.form.$valid {
      // do something!
    }
  }
})
```

This addition that promotes code reuse and executing parsers from parent/sibling models. it's merely an exposed function that was took from inside the `$setViewValue`. It's useful to execute the parsers from the current ngModel $viewValue or an arbitrary string, without messing with the `$viewValue` and `$modelValue`, without triggering the events that `$setViewValue` triggers.

For example:

```js
var test = angular.module('test', []);
test.directive('test', function(){
  return {
    'require': 'ngModel',
    'link': function($scope, $el, attrs, model){
      model.$parsers.push(function(value){
        return value.replace(/-/g, '|');
      });
      model.$setViewValue('loop-hole');
    }
  };
});

test.directive('test2', function(){
  return {
    'require': 'ngModel',
    'template': '<input type="button" data-value="{{x}}" value="{{$parent.value}}">',
    'link': function($scope, $el, attrs, model){
      $scope.x = '';

      $el.on('click', function(){
        $scope.x = model.$parse($el.val()); // arbitrary value, if the value is COOL-GANG, it returns to COOL|GANG
        //$scope.x = model.$parse(); // current $viewValue, loop-hole, that returns loop|hole, which is obviously the current $modelValue, so not much of use
      });
    }
  };
});
```
